import './BillingMainContent.scss';
import BillingInfoSection from './BillingInfoSection';
import BillingPaymentSection from './BillingPaymentSection';

export default function BillingMainContent() {
	return(
		<>
			<BillingPaymentSection />

			<div className='row'>
				<BillingInfoSection />
			</div>
		</>
	)
}
